import React, {useEffect, useRef, useState} from 'react';
import CssBaseline from '@mui/material/CssBaseline';
import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';
import Grid from '@mui/material/Grid';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Chart from 'chart.js/auto';

const Dashboard: React.FC = () => {
    const [graphData, setGraphData] = useState<number[]>([10, 20, 30, 40, 50]);
    const [graphQuery, setGraphQuery] = useState<string>(''); // State for the graph query
    const chartContainerRef = useRef<HTMLDivElement | null>(null);
    const myChartRef = useRef<Chart | null>(null);

    //  const graphData = [60, 40, 80, 30, 70];



    const handleGenerateGraph = () => {
        // Check if myChart exists, and destroy it if it does
        if (myChartRef.current !== null) {
            myChartRef.current.destroy();
        }

        // Your code to generate or fetch data and create a new chart goes here
        const graphData = [60, 40, 80, 30, 70];

        // Create a new canvas element
        const canvas = document.createElement('canvas');
        canvas.width = 400; // Set the width and height as per your requirement
        canvas.height = 400;

        // Append the canvas to the chart container
        if (chartContainerRef.current) {
            chartContainerRef.current.innerHTML = ''; // Clear previous charts
            chartContainerRef.current.appendChild(canvas);
        }

        // Create a new chart
        const ctx = canvas.getContext('2d');
        if (ctx) {
            myChartRef.current = new Chart(ctx, {
                type: 'bar',
                data: graphData,
                // ... other chart configurations
            });
        }
    };
    const handleCloseChart = () => {
        // Check if myChart exists, and destroy it if it does
        if (myChartRef.current !== null) {
            myChartRef.current.destroy();
        }

        // Clear the chart container
        if (chartContainerRef.current) {
            chartContainerRef.current.innerHTML = '';
        }
    };

    return (
        <Container component="main" maxWidth="lg" >
            <CssBaseline />
            <Typography variant="h4" component="div" gutterBottom>
                Admin Dashboard
            </Typography>

            {/* Dashboard Details */}
            <Grid container spacing={3}>
                {/* Amount of Patients */}
                <Grid item xs={12} sm={6} md={3}>
                    <div className="dashboard-item">
                        <Typography variant="h6" gutterBottom>
                            Patients
                        </Typography>
                        <Typography variant="h4">100</Typography>
                    </div>
                </Grid>

                {/* Amount of Users */}
                <Grid item xs={12} sm={6} md={3}>
                    <div className="dashboard-item">
                        <Typography variant="h6" gutterBottom>
                            Users
                        </Typography>
                        <Typography variant="h4">50</Typography>
                    </div>
                </Grid>

                {/* Amount of Events */}
                <Grid item xs={12} sm={6} md={3}>
                    <div className="dashboard-item">
                        <Typography variant="h6" gutterBottom>
                            Events
                        </Typography>
                        <Typography variant="h4">20</Typography>
                    </div>
                </Grid>

                {/* Add more items as needed */}
            </Grid>

            {/* Graph Input Section */}
            <div style={{ marginTop: '2rem' }}>
                <Typography variant="h5" gutterBottom>
                    Graph Input
                </Typography>
                <TextField
                    label="Graph Query"
                    variant="outlined"
                    fullWidth
                    value={graphQuery}
                    onChange={(e) => setGraphQuery(e.target.value)}
                />
                <Button variant="contained" color="primary" onClick={handleGenerateGraph} style={{ marginTop: '1rem' }}>
                    Generate Graph
                </Button>

                {/* Chart Container */}
                <div style={{ marginTop: '2rem', height: '400px' }}>
                    <canvas id="myChart" width="400" height="400"></canvas>
                </div>
            </div>
        </Container>
    );
};

export default Dashboard;
